import React from "react";
import ReactDOM from "react-dom";

function Card(props){
  return <div>
  <h1>My Contacts</h1>
    <h1>{props.name}</h1>
    <img src={props.img} alt={props.alt} />
    <p>{props.cell}</p>
    <p>{props.email}</p>
  </div>
}

